import { useContext } from "react";
import { dataContext } from "../components/context/DataContext";

import { Link } from "react-router-dom";

const imageStyle = {
  width: "240px",
  height: "240px",
};
const VideoProductions = () => {
  const { videosProductions } = useContext(dataContext);

  return videosProductions.map((videos) => {
    return (
      <div className='plantsCard' key={videos.id}>
        <Link to={`/${videos.id}`}>
          <img style={imageStyle} src={videos.img} alt='Monstera Picture' />
          <h5>{videos.name}</h5>
        </Link>
      </div>
    );
  });
};

export default VideoProductions;
